column8:
「エリザベス ボンボン スティックグロス 04ベリーピンク」は、とろける新感覚、オールインワンリップ(リップグロス)です。リップグロスがスティック状になったかのような、とろけるテクスチャー(塗り心地)で、潤うのにベタつきません。リップバーム成分、ワセリン保湿成分、コラーゲン、ヒアルロン酸、ローヤルゼリーエキス、アプリコット油、インドナガコショウ果実エキス、トウガラシエキス配合で、唇の潤いを守り、ぷっくりツヤツヤに仕上げます。1度塗りで見た目の色がキレイに発色。つけたての色とツヤが持続します。SPF20 PA++。<br /><br />ご注意<br /><br />●中身は、一度出すと元に戻りません。出し過ぎないようにご注意ください。中身がくり出せなくなったら使い終わりです。<br />●使用後は、しっかりキャップを閉めてください。キャップ内や容器まわりに中身が付着した場合は、ティッシュ等でふきとり、清潔にお使いください。<br />●清潔に使用するために、食後などに使用する際は口元をきれいに拭いてからご使用ください。<br />●傷、はれもの、湿疹等、異常のある部位には、ご使用をおやめください。<br />●使用中、又は使用後日光にあたって、赤味、はれ、かゆみ、刺激等の異常があらわれたときは、使用を中止し、皮フ化専門医又は、弊社へのご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと、悪化することがあります。<br />●高温の場所、又は直射日光のあたる場所には置かないでください。<br />●乳幼児の手の届かないところに保管してください。<br />●高温条件下での保管や、急激な温度変化により、口紅表面が汗をかいたようになる場合がありますので、ご注意ください。<br />●製品の性質上、塗布面が濃い色に変化する場合がありますが、品質には問題はありません。<br />●使用量が少ないと紫外線防止効果が得られにくくなります。商品のSPF表示及びPA表示は国際的に定められている標準塗布量に従い、1cm平方あたり2mgを皮フに塗布して測定した結果です。<br /><br />配合成分<br /><br />水添ポリイソブテン、トリイソステアリン酸ポリグリセリル-2、リンゴ酸ジイソステアリル、ミネラルオイル、ワセリン、ジメチルシリル化シリカ、ヒマシ油、テトラヘキシルデカン酸アスコルビル、アンズ核油、イソステアロイル加水分解コラーゲン、ローヤルゼリーエキス、ヒアルロン酸Na、パルミチン酸デキストリン、t-ブチルメトキシジベンゾイルメタン、トコフェロール、プロピルパラベン、トリ(カプリル酸/カプリン酸)グリセリル、ジメチコン、スクワラン、イソステアリン酸、パルミチン酸エチルヘキシル、水添ヒマシ油、BG、ヘキシレングリコール、カプリリルグリコール、フェノキシエタノール、酸化チタン、橙201、赤226、黄4、赤218<br /><br />お問い合わせ先<br /><br />株式会社エリザベス<br />TEL：03-3262-4061<br />受付時間 9：00-17：30(土・日・祝日・年末年始・夏季休暇等を除く)<br /><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
